function changeBackgroundColor() {
  const category = document.getElementById("category").value;
  let color = "";

  switch (category) {
    case "house": color = "#dce8d5"; break;
    case "outdoor": color = "#cce7ff"; break;
    case "tropical": color = "#fff4cc"; break;
    case "succulent": color = "#f4dfd0"; break;
    default: color = "#f0f9f0";
  }

  document.body.style.backgroundColor = color;
}

