function loadPlants() {
  const category = document.getElementById("category").value;
  const plantSelect = document.getElementById("plant");
  plantSelect.innerHTML = "";

  if (plantData[category]) {
    const defaultOption = document.createElement("option");
    defaultOption.text = "--Select--";
    plantSelect.add(defaultOption);

    for (let plant in plantData[category]) {
      const option = document.createElement("option");
      option.value = plant;
      option.text = plant;
      plantSelect.add(option);
    }
  } else {
    const option = document.createElement("option");
    option.text = "--Select a category first--";
    plantSelect.add(option);
  }
}

function displayPlantImage() {
  const category = document.getElementById("category").value;
  const plant = document.getElementById("plant").value;
  const imgEl = document.getElementById("plantImage");

  if (plantData[category] && plantData[category][plant]) {
    imgEl.src = plantData[category][plant].img;
    imgEl.style.display = "block";
  } else {
    imgEl.style.display = "none";
  }
}

function giveFeedback() {
  const category = document.getElementById("category").value;
  const plant = document.getElementById("plant").value;
  const temp = parseInt(document.getElementById("temp").value);
  const humidity = parseInt(document.getElementById("humidity").value);
  const watering = parseInt(document.getElementById("watering").value);
  const feedback = document.getElementById("feedback");

  if (!plant || !category || isNaN(temp) || isNaN(humidity) || isNaN(watering)) {
    feedback.textContent = "Please fill out all fields correctly.";
    return;
  }

  const data = plantData[category][plant];
  let issues = [];

  if (temp < data.temp[0] || temp > data.temp[1]) {
    issues.push(`Temperature should be between ${data.temp[0]}F and ${data.temp[1]}F.`);
  }
  if (humidity < data.humidity[0] || humidity > data.humidity[1]) {
    issues.push(`Humidity should be between ${data.humidity[0]}% and ${data.humidity[1]}%.`);
  }
  if (watering !== data.watering) {
    issues.push(`You should water this plant ${data.watering} time(s) per week.`);
  }

  if (issues.length === 0) {
    feedback.textContent = "Great job! Your plant conditions are just right.";
  } else {
    feedback.innerHTML = "Suggestions:<br>" + issues.join("<br>");
  }
}